import './App.css';
import Greet from './Components/Greet';
import Welcome from './Components/Welcome';
// import Hello from './Components/Hello';
import Message  from './Components/Message';
import Counter from './Components/Counter';
import Functionclick from './Components/Functionclick';
import ClassClick from './Components/ClassClick';
import EventBind from './Components/EventBind';
import BasicButtons from './Components/Button';
// import SplitButton from './Components/Splitbutton';
// import MaterialUIbutton from './Components/MaterialUIbutton';
import Button from '@material-ui/core'
import RecipeReviewCard from './Components/Card';
import SimplePaper from './Components/Paper';
import ActionAreaCard from './Components/Lizcard';
import Header from './Components/Header';
import Palette from './Components/Button1';
import Stack from '@mui/material/Stack';
// import MaterialUIbutton from './Components/MaterialUIbutton'

function App() {
  return (
    <div className="App">
      <Stack paddingLeft={135} direction="row" spacing={2}>
        <Palette>home</Palette>
        <Palette>about</Palette>
        <Palette>achivements</Palette>
        <Palette>publications</Palette>
      </Stack>

      <img src="public/chem1.gif" alt="Chemical Animation"></img>
      <Header>

      </Header>
      <Palette>Hey</Palette>
      {/* <Greet name="Ayyappa" heroname="Ironman"> */}
          {/* <p>hehe Ironman</p> Children Tag */}
        {/* </Greet> */}
      <Greet name="Daanki" heroname="Naruto">
          <button>Action</button>
        </Greet>
      <Greet name="Akhil" heroname="-_-"/>
      <Welcome/>
      <Message/>
      <Counter/>
      {/* <Hello/> */}
      <Functionclick/>
      <ClassClick/>
      <EventBind/>

      <button class='button button-blue'>
        <b>
         OK!
        </b>
      </button>

      <BasicButtons></BasicButtons>
      <RecipeReviewCard></RecipeReviewCard>
      <BasicButtons></BasicButtons>
      <RecipeReviewCard></RecipeReviewCard>

      {/* <MaterialUIbutton/> */}
      {/* <MaterialUIbutton/> */}
      <SimplePaper></SimplePaper>
      {/* <SimplePaper></SimplePaper> */}
      <ActionAreaCard></ActionAreaCard>
    </div>
  );
}

export default App;
